Verenigde Staten
Drama
144 minuten

geregisseerd door Paul Thomas Anderson
met Joaquin Phoenix, Philip Seymour Hoffman en Amy Adams

Vlak na de Tweede Wereldoorlog komt de getraumatiseerde marinier Freddie Quell (Phoenix)
terug in de Verenigde Staten en vindt het moeilijk een stabiel bestaan te leiden. Als hij
de charismatische sekteleider Lancaster Dodd (Hoffman) ontmoet ontstaat er een speciale band
tussen hen.


